import React from 'react';
import './FrameLayout.css';
import PageFooter from './../page_footer/PageFooter';
import PageHeader from './../page_header/PageHeader.js';

function FrameLayout({ customHeader, children }) {
    setState({ hasCustomHeader : customHeader !== undefined })

  return (
    <div className="frame-layout">
        {!this.hasCustomHeader && <PageHeader />}
        {this.hasCustomHeader && customHeader }
        <div className={this.hasCustomHeader ? "body-slot" : ""}>
            { children }
        </div>
        <PageFooter />
    </div>
  );
}

export default FrameLayout;
